	add("stichomythia", "{\"term\":\"stichomythia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin from Ancient greek (to 1453) \u0027στιχομυθία\u0027 from \u0027στίχος\u0027 (line of verse) + \u0027μῦθος\u0027 (speech)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A technique in drama or poetry, in which alternating lines, or half-lines, are given to alternating characters, voices, or entities\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Olga Freidenberg, \u0027Image and Concept\u0027, [http://books.google.com.au/books?id\u003dat2OAgAAQBAJ\u0026amp;pg\u003dPA297\u0026amp;dq\u003d%22stichomythia%22%7C%22stichomythias%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dEl-IU57uFIeskgXTpYDQBw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22stichomythia%22%7C%22stichomythias%22\u0026amp;f\u003dfalse page 297\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027stichomythias\u0027\u0027 are just as necessary in Sophocles\u0027 tragedies as are his choruses\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, R. B. Rutherford, \u0027Greek Tragic Style: Form, Language and Interpretation\u0027, [http://books.google.com.au/books?id\u003dPrjjSKLd01gC\u0026amp;pg\u003dPA165\u0026amp;dq\u003d%22stichomythia%22%7C%22stichomythias%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dEl-IU57uFIeskgXTpYDQBw\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22stichomythia%22%7C%22stichomythias%22\u0026amp;f\u003dfalse page 165\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The two modes have different effects: while a rhesis allows the speaker to give an account of himself, attempt to persuade his hearers, or move freely across a range of emotions or types of argument, \u0027\u0027stichomythia\u0027\u0027 is better suited to swift exchange of information through question and answer, though it can also be used for spicy polemic, aggressive interrogation, or accusation and defence\", \"priority\":7}]}, \"synonyms\":{}}");

	add("stickball", "{\"term\":\"stickball\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|stick|ball|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A street game similar to baseball, played with a stick, a ball and various ad hoc materials; found primarily in large cities in the northeastern United States\", \"priority\":1}]}, \"synonyms\":{}}");

	add("stickiness", "{\"term\":\"stickiness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|sticky|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the property of sticking or adhering; adhesio\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"date\u003d23 December passage\u003d The flesh [of the mistletoe berry] is sticky, and forms strings and ribbons between my thumb and forefinger. For the mistletoe, this viscous goop\u0026amp;nbsp;– and by the way, viscous comes to English from viscum\u0026amp;nbsp;– is crucial. The \u0027\u0027stickiness\u0027\u0027 means that, after eating the berries, birds often regurgitate the seeds and then wipe their bills on twigs\u0026amp;nbsp;– leading to the seeds\u0027 getting glued to the tree, where they can germinate and begin the cycle anew\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"warmth and humidity, as on a muggy da\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"the tendency to stay the same despite changes in the econom\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"the presence of unique attributes that make a product indisposable and valuable to its owne\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027stickiness\u0027\u0027 of a cellphone might be measured by its ability to tell correct time, locate its user, and allow its user to remain connected regardless of location\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"a research measure that captures the extent to which viewers wish to spend more time looking at or reading a print ad\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The low \u0027\u0027stickiness\u0027\u0027 rating helped explain why our ad’s brand linkage rating was so low: people were turned off by the blurriness of the main photo\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"an overemotional attachment to others; clinging in interpersonal relations; difficulty with ending conversations\", \"priority\":9}]}, \"synonyms\":{}}");

	add("stickler", "{\"term\":\"stickler\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|stickle|er|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A referee or adjudicator at a fight, wrestling match, duel, etc. who ensures fair play\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"II.27\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In ancient time they were wont to employ third persons as \u0027\u0027sticklers\u0027\u0027, to see no treachery or disorder were used, and to beare witnes of the combates successe\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Sir Philip Sidne\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Basilius, the judge, appointed \u0027\u0027sticklers\u0027\u0027 and trumpets whom the others should obey\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Dryde\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Our former chiefs, like \u0027\u0027sticklers\u0027\u0027 of the war, / First sought to inflame the parties, then to poise\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Someone who insistently advocates something\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Lexicographers are \u0027\u0027stickler\u0027\u0027s for correct language\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Jonathan Swif\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The Tory or High-church were the greatest \u0027\u0027sticklers\u0027\u0027 against the exorbitant proceedings of King James II\", \"priority\":11}]}, \"synonyms\":{}}");

