	add("stingo", "{\"term\":\"stingo\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|sting|o|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"strong bee\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Addiso\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Shall I set a cup of old \u0027\u0027stingo\u0027\u0027 at your elbow\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Sir Walter Scot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The elevated cavaliers sent for two tubs of merry \u0027\u0027stingo\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"John Clar\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"For my outside I never need fear me / While warm with real \u0027\u0027stingo\u0027\u0027 within\", \"priority\":7}]}, \"synonyms\":{}}");

	add("stinkbug", "{\"term\":\"stinkbug\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|stink|bug|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Insects, usually shield-shaped, that possess a gland that produces a foul smelling liquid, usually containing aldehydes which they use to discourage predators\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A common name applied to various insects of the Hemiptera order (the \u0026quot;true bugs\u0026quot;), in the Heteroptera suborder, principally in the superfamilies \u0027\u0027 and\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A or (genus ) that releases a pungent odor when threatened\", \"priority\":3}]}, \"synonyms\":{}}");

	add("stinker", "{\"term\":\"stinker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who stinks\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A contemptible person\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I won\u0027t date Mary Jane again. I thought she was a \u0027\u0027stinker\u0027\u0027 to leave before the end of the movie\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"section\u003dchapter passage\u003dNever be a \u0027\u0027stinker\u0027\u0027, because if you are, though you may flourish for a time like a green bay tree, sooner or later retribution will overtake you\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Something difficult (e.g. a given puzzle) or unpleasant (e.g. negative review, nasty letter\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Today\u0027s crossword is a \u0027\u0027stinker\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"section\u003dchapter passage\u003dI number several authors among my aquaintance [...] and they invariably become all of a doodah when they read a \u0027\u0027stinker\u0027\u0027 in the press about their latest effort\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"section\u003dchapter passage\u003dI sat there seething with fury. And after I had seethed for a bit I rose from my chair, took pen in hand and wrote Bobbie a \u0027\u0027stinker\u0027\u0027. [...] I accused her in set terms of giving me the heave-ho in order that she could mercenarily marry a richer man. I called her a carrot-topped Jezebel whom I was thankful to have got out of my hair. I... Oh, I can\u0027t remember what else I said but, as I say, it was a \u0027\u0027stinker\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Something of poor quality\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"April 19 2002\u0027\u0027, Scott Tobias, AV Club \u0027Dark Tide\u0027[http://www.avclub.com/articles/dark-tide,72548\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The barely-released \u0027\u0027stinker\u0027\u0027 \u0027Dark Tide\u0027 continues Stockwell’s fetishistic pattern, coming alive whenever it’s paddling among the sharks off the South African coast and settling in for a long snooze once it gets back on the boat or reaches dry land\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Any of several species of large Antarctic petrels which feed on blubber and carrion and have an offensive odour, such as the giant fulmar.\u0026lt;!--Webster 1913--\u0026gt\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A chemist\", \"priority\":13}]}, \"synonyms\":{}}");

