	add("stipend", "{\"term\":\"stipend\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027stipende\u0027 from Latin \u0027stipendium\u0027 (pay, stipend)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A scholarship granted to a student\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a fixed payment, generally small and occurring at regular intervals; a modest allowanc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"My \u0027\u0027stipend\u0027\u0027 for doing public service is barely enough to cover living expenses\", \"priority\":3}]}, \"synonyms\":{}}");

	add("stipulation", "{\"term\":\"stipulation\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027stipula\u0027 (a straw) Romans used to break a straw, as a sign of agreement between the negotiating parties, and the \u0027stipulations\u0027 were put in a written form.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of stipulating; a contracting or bargaining; an agreement\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Something that is stated or stipulated as a condition of an agreement\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027stipulations\u0027\u0027 of the contract won\u0027t allow you to do that\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"If I lend you my car, my only \u0027\u0027stipulation\u0027\u0027 is that you fill up the gas tank before returning it\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The situation, arrangement, and structure of the stipules\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A goal to be achieved in a [https://en.wikipedia.org/wiki/Chess_problem chess problem]; for example, to checkmate Black within a specified number of moves\", \"priority\":6}]}, \"synonyms\":{}}");

