	add("stirrer", "{\"term\":\"stirrer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|stir|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A device used to stir\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"We\u0027re out of coffee \u0027\u0027stirrers\u0027\u0027 again and I\u0027m not using my finger\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A person who stirs something\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027stirrers\u0027\u0027 in the chocolate factory often get chocolate all over their uniforms\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A person who spreads rumours or causes agitation\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Why would you say something so hurtful? God, you are such a \u0027\u0027stirrer\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"One who stirs or moves about, as after sleep\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1597\u0027\u0027, w: William William Shakespeare, \u0027s: The Second Part of King Henry the Henry IV, Part 2\u0027, III. ii. 3\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"An early \u0027\u0027stirrer\u0027\u0027, by / the rood\", \"priority\":9}]}, \"synonyms\":{}}");

