	add("stiver", "{\"term\":\"stiver\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle low german\", \"Dutch\"], \"text\":\"From Dutch \u0027stuiver\u0027, cognate with Middle low german \u0027stüver\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A small Dutch coin worth one twentieth of a guilder\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Anything of small value\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1761\u0027\u0027, w:Laurence Laurence Sterne, \u0027The Life \u0026amp; Opinions of Tristram Shandy, Gentleman\u0027, vol. 4 (Penguin 2003, p. 223\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"’Tis not worth a single \u0027\u0027stiver\u0027\u0027, said the bandy-leg\u0027d drummer\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1851\u0027\u0027, w:Herman Herman Melville, \u0027w:Moby Moby Dick\u0027, s:Moby-Dick/Chapter chapter 1\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A]ll hands, including the captain, received certain shares of the profits called lays . . . . And though the 275th lay was what they call a rather long lay, yet it was better than nothing; and if we had a lucky voyage, might pretty nearly pay for the clothing I would wear out on it, not to speak of my three years\u0027 beef and board, for which I would not have to pay one \u0027\u0027stiver\", \"priority\":6}]}, \"synonyms\":{}}");

